/* import logo from './logo.svg'; */
import './App.css';
import DaisyNavBar from './components/DaisyNavBar';
import Saludo from './components/Saludo';

function App() {
  return (
      <div className="App">
        <DaisyNavBar/>
        <h1 className="text-3xl font-bold font-mono"> Primera App en React</h1>
        <h2> Entrega del NAV</h2>
        <Saludo name='Charles'/>
      </div>

  );
}

export default App;
